INSERT INTO `files` VALUES (1,'系统使用说明',1,1,'markdown','jasonroger',1,'2015-12-12 17:14:34','2015-12-12 17:14:34','***\n# 欢迎使用云笔记系统\n\n------\n为了便于大家管理自己的技术资料，项目资料以及生活中的琐事儿，我们为大家开发了一个云笔记系统，通过该系统你可以实现如下管理：\n\n> 私人定制管理目录\n> 创建markdown文档\n> 在线编辑web代码\n> 创建word文档\n> 可以无限的嵌套目录\n\n------\n\n## 系统整体介绍\n\n![](/images/whole.png)\n- 通过点击左上方的**+**号，你可以创建属于自己的管理主题\n- 通过在空白区域单击右键，将会出现右键菜单\n- 通过右上角的人头图标，你可以修改密码或者推出系统\n\n### 1. 新建markdown文档\n![](/images/markdown.png)\n\n如果不熟悉markdown文档的基本语法，建议百度了解一下，为了便于大家使用，我们特意添加了工具栏，通过工具栏，你可以很方便的创建属于自己的markdown文档，另外每次新建时，都会默认给出常用的markdown文档，供大家参考。\n\n### 2. 在线编辑代码（新建代码）\n![](/images/code.png)\n\n在线编辑器分做三个区域，左上方为html代码编辑区，左下方为javascript编辑器，中间部分为css代码编辑区，右方为效果预览区。如果你想预览html和js代码，只需按ctrl + s键便可在右方预览效果，对于css代码，则是实时预览，另外js默认引入jquery，所以你可以放心的使用jquery来进行编码。\n### 3. 新建word文档\n![](/images/word.png)\n\n作者 [@jasonroger]   \n2015 年 11月 06日    \n\n***\n\n\n',NULL,NULL,NULL,0),(5,'mice系统',1,2,'folder','jasonroger',1,'0000-00-00 00:00:00','2015-12-13 15:28:29','','','','',0),(6,'相关资料',2,5,'markdown','jasonroger',1,'0000-00-00 00:00:00','2015-12-14 02:10:07','***\n# 相关资料\n\n原页面： http://scm.qunar.com/qbm/apply.htm?mobile=&source=\nwiki地址： http://wiki.corp.qunar.com/pages/viewpage.action?pageId=99283451\n接口： http://wiki.corp.qunar.com/pages/viewpage.action?pageId=100025821\nbugfee: http://bugfree.corp.qunar.com/index.php/bug/list/21\n图片： https://owncloud.corp.qunar.com/public.php?service=files&t=473cb97467f871c6bf4d35f92886130e\npmo: http://pmo.corp.qunar.com/browse/MICE-13\n\n------\n\n作者 [@jasonroger][3]     \n2015 年 11月 01日    \n\n\n','','','',0),(7,'mysql',1,5,'folder','jasonroger',1,'0000-00-00 00:00:00','2015-12-13 15:30:11','','','','',0),(8,'基本命令',2,7,'markdown','jasonroger',1,'0000-00-00 00:00:00','2015-12-14 03:54:08','---\n# 查看类\n------\n- show databases  查看所有数据库\n- show tables  查看所有表\n- show columns from users  查看表中的字段信息\n- show full columns from yunnote_files; 查看数据表中字符集设置\n- show character set; 或者 show char set 查看数据库支持的所有字符集\n- status 或 /s  查看当前状态，里面当然包括字符集的设置\n- show variables like \'%char%\'; 查看系统字符集设置，包括所有的字符集设置\n- show create table tablename/G; 查看数据表中字符集设置\n- show create database dbname; 查看数据库编码\n#取消\n- \\c 取消当前输入\n#修改字符集\n[client]\ndefault-character-set=utf8\n[mysqld]\ndefault-storage-engine=INNODB\ncharacter-set-server=utf8\ncollation-server=utf8_general_ci\n#创建时指定字符集\n###服务器级\n在安装MySQL时可以设置服务器的默认编码格式，也可对my.ini做修改，修改[mysqld]里面的character_set_server=utf8，则可设置character_set_server的值。\n###数据库级\nCREATE DATABASE db_name DEFAULT CHARACTER SET utf8;\n###表级\nCREATE TABLE  `db_name`.`tb_name` (id VARCHAR(20) NOT NULL,name VARCHAR(20) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;\n###列级\nCREATE TABLE  `db_name`.`tb_name` (   id varchar(20) NOT NULL,   name varchar(20) CHARACTER SET utf8 );\n\n#修改字符集命令\n###.修改character_set_connection、character_set_client、character_set_results三值\nSET NAMES \'charset_name\' [COLLATE \'collation_name\']\n相当于\nSET character_set_client = charset_name; SET character_set_results = charset_name; SET character_set_connection = charset_name;\n###修改character_set_database字段\nALTER DATABASE db_name     [[DEFAULT] CHARACTER SET charset_name]     [[DEFAULT] COLLATE collation_name]\n###修改表的字符集\nALTER TABLE tbl_name     [[DEFAULT] CHARACTER SET charset_name]     [COLLATE collation_name]\n###修改列的字符集\ncol_name {CHAR | VARCHAR | TEXT} (col_length)     [CHARACTER SET charset_name]     [COLLATE collation_name]\n\n\n作者 [@jasonroger][3]     \n\n\n','','','',0),(9,'javascript',1,5,'folder','jasonroger',2,'0000-00-00 00:00:00','2015-12-14 02:12:27','','','','',0),(10,'jquery',1,5,'folder','jasonroger',3,'0000-00-00 00:00:00','2015-12-14 02:12:32','','','','',0),(11,'css',1,5,'folder','jasonroger',4,'0000-00-00 00:00:00','2015-12-14 02:12:45','','','','',0),(12,'html5',1,5,'folder','jasonroger',5,'0000-00-00 00:00:00','2015-12-14 02:25:00','','','','',0),(13,'第1章 JavaScript概述.pdf',2,9,'pdf','jasonroger',1,'0000-00-00 00:00:00','2015-12-16 09:19:28','','','','',286190),(14,'第2章 使用JavaScript.pdf',2,9,'pdf','jasonroger',2