3弹性伸缩布局[中].pdf',3,76,'pdf','jasonroger',25,'0000-00-00 00:00:00','2015-12-14 02:32:15','public/uploads/pdf/16c5a1e8d7385519130d979126822f36','','','',158479),(102,'第29章 CSS3弹性伸缩布局[下].pdf',3,76,'pdf','jasonroger',26,'0000-00-00 00:00:00','2015-12-14 02:32:22','public/uploads/pdf/0c07635a39e832fd7bc9ad67a76b9f78','','','',164251),(103,'linux',1,6,'folder','jasonroger',1,'0000-00-00 00:00:00','2015-12-14 02:33:23','','','','',0),(104,'Linux指令目录（按功能）.pdf',2,103,'pdf','jasonroger',1,'0000-00-00 00:00:00','2015-12-14 02:33:41','public/uploads/pdf/6fcfa0174cdd5f7aa3653a71006e47be','','','',717818),(105,'系统使用说明',1,8,'markdown','zhangjun.wang',1,'2015-12-14 03:26:43','2015-12-14 03:26:43','***\n# 欢迎使用云笔记系统\n\n------\n为了便于大家管理自己的技术资料，项目资料以及生活中的琐事儿，我们为大家开发了一个云笔记系统，通过该系统你可以实现如下管理：\n\n> 私人定制管理目录\n> 创建markdown文档\n> 在线编辑web代码\n> 创建word文档\n> 可以无限的嵌套目录\n\n------\n\n## 系统整体介绍\n\n![](/images/whole.png)\n- 通过点击左上方的**+**号，你可以创建属于自己的管理主题\n- 通过在空白区域单击右键，将会出现右键菜单\n- 通过右上角的人头图标，你可以修改密码或者推出系统\n\n### 1. 新建markdown文档\n![](/images/markdown.png)\n\n如果不熟悉markdown文档的基本语法，建议百度了解一下，为了便于大家使用，我们特意添加了工具栏，通过工具栏，你可以很方便的创建属于自己的markdown文档，另外每次新建时，都会默认给出常用的markdown文档，供大家参考。\n\n### 2. 在线编辑代码（新建代码）\n![](/images/code.png)\n\n在线编辑器分做三个区域，左上方为html代码编辑区，左下方为javascript编辑器，中间部分为css代码编辑区，右方为效果预览区。如果你想预览html和js代码，只需按ctrl + s键便可在右方预览效果，对于css代码，则是实时预览，另外js默认引入jquery，所以你可以放心的使用jquery来进行编码。\n### 3. 新建word文档\n![](/images/word.png)\n\n作者 [@jasonroger]   \n2015 年 11月 06日    \n\n***\n\n\n',NULL,NULL,NULL,0),(106,'MD',1,9,'markdown','zhangjun.wang',1,'0000-00-00 00:00:00','2015-12-14 03:28:11','***\n# 欢迎使用 Markdown 编辑阅读器\n\n------\n\n我们理解您需要更便捷更高效的工具记录思想，整理笔记、知识，并将其中承载的价值传播给他人，** Markdown** 是我们给出的答案 —— 我们为记录思想和分享知识提供更专业的工具。 您可以使用 Markdown：\n\n> 整理知识，学习笔记\n> 发布日记，杂文，所见所想\n> 撰写发布技术文稿（代码支持）\n> 撰写发布学术论文（LaTeX 公式支持）\n[![](/images/markdown.jpg)](/images/markdown.jpg)\n除了您现在看到的这个 Markdown 在线版本，您还可以前往以下网址下载：\n\n------\n\n## 什么是 Markdown\n\nMarkdown 是一种方便记忆、书写的纯文本标记语言，用户可以使用这些标记符号以最小的输入代价生成极富表现力的文档：譬如您正在阅读的这份文档。它使用简单的符号标记不同的标题，分割不同的段落，**粗体** 或者 *斜体* 某些文字，更棒的是，它还可以\n\n### 1. 高亮一段代码[^code]\n##### JS代码　\n\n```javascript\nfunction test() {\n    console.log(\"Hello world!\");\n}\n(function(){\n    var box = function() {\n        return box.fn.init();\n    };\n})();\n\nvar testBox = box();\n```\n\n##### HTML 代码 HTML codes\n\n```html\n<!DOCTYPE html>\n<html>\n    <head>\n        <mate charest=\"utf-8\" />\n        <title>Hello world!</title>\n        <style type=\"text/css\">\n            ul{list-style: none;}\n            img{border:none;vertical-align: middle;}\n        </style>\n    </head>\n    <body>\n        <h1 class=\"text-xxl\">Hello world!</h1>\n    </body>\n</html>\n```\n\n### 2. 高效绘制 [流程图](https://www.baidu.com)\n\n```flow\nst=>start: Start\nop=>operation: Your Operation\ncond=>condition: Yes or No?\ne=>end\n\nst->op->cond\ncond(yes)->e\ncond(no)->op\n```\n\n### 3. 高效绘制 [序列图](https://www.baidu.com)\n\n```seq\nAlice->Bob: Hello Bob, how are you?\nNote right of Bob: Bob thinks\nBob-->Alice: I am good thanks!\n```\n\n### 4. 绘制表格\n\n| 项目        | 价格   |  数量  |\n| --------   | -----:  | :----:  |\n| 计算机     | \\$1600 |   5     |\n| 手机        |   \\$12   |   12   |\n| 管线        |    \\$1    |  234  |\n\n### 5. 更详细语法说明\n\n想要查看更详细的语法说明，可以参考我们准备的 [Markdown 简明语法手册][1]，进阶用户可以参考 [Markdown 高阶语法手册][2] 了解更多高级功能。\n\n总而言之，不同于其它 *所见即所得* 的编辑器：你只需使用键盘专注于书写文本内容，就可以生成印刷级的排版格式，省却在键盘和工具栏之间来回切换，调整内容和格式的麻烦。**Markdown 在流畅的书写和印刷级的阅读体验之间找到了平衡。** 目前它已经成为世界上最大的技术分享网站 GitHub 和 技术问答网站 StackOverFlow 的御用书写格式。\n\n---\n\n作者 [@jasonroger][3]     \n2015 年 11月 01日    \n\n\n','','','',0),(107,'html  js  css',1,9,'code','zhangjun.wang',2,'0000-00-00 00:00:00','2015-12-14 03:30:57','','<!DOCTYPE html>\n<html>\n<head>\n  <meta charset=\"utf-8\">\n  <title>preview</title>\n</head>\n<body>\n  <div class=\"test\"></div>\n</body>\n</html>','.test {\n  width: 100px;\n  height: 100px;\n  background: red;\n}','console.log(document.getElementsByClassName(\"test\")[0]);alert(1231)',0),(108,'基本链接',1,4,'markdown','jasonroger',1,'0000-00-00 00:00:00','2015-12-15 15:01:10','***\n\nfekit组件： http://l-registry.fe.dev.cn6.qunar.com/\n\n------\n\n作者 [@jasonroger][3]     \n2015 年 11月 01日    \n\n\n','','','',0),(111,'系统使用说明',1,10,'markdown','chengmi.deng',1,'2015-12-15 09:15:12','2015-12-15 09:15:12','***\n# 欢迎使用云笔记系统\n\n------\n为了便于大家管理自己的技术资料，项目资料以及生活中的琐事儿，我们为大家开发了一个云笔记系统，通过该系统你可以实现如下管理：\n\n> 私人定制管理目录\n> 创建markdown文档\n> 在线编辑web代码\n> 创建word文档\n> 可以无限的嵌套目录\n\n------\n\n## 系统整体介绍\n\n![](/images/whole.png)\n- 通过点击左上方的**+**号，你可以创建属于自己的管理主题\n- 通过在空白区域单击右键，将会出现右键菜单\n- 通过右上角的人头图标，你可以修改密码或者推出系统\n\n### 1. 新建markdown文档\n![](/images/markdown.png)\n\n如果不熟悉markdown文档的基本语法，建议百度了解一下，为了便于大家使用，我们特意添加了工具栏，通过工具栏，你可以很方便的创建属于自己的markdown文档，另外每次新建时，都会默认给出常用的markdown文档，供大家参考。\n\n### 2. 在线编辑代码（新建代码）\n![](/images/code.png)\n\n在线编辑器分做三个区域，左上方为html代码编辑区，左下方为javascript编辑器，中间部分为css代码编辑区，右方为效果预览区。如果你想预览html和js代码，只需按ctrl + s键便可在右方预览效果，对于css代码，则是实时预览，另外js默认引入jquery，所以你可以放心的使用jquery来进行编码。\n### 3. 新建word文档\n![](/images/word.png)\n\n作者 [@jasonroger]   \n2015 年 11月 06日    \n\n***\n\n\n',NULL,NULL,NULL,0),(112,'正则表达式.pdf',1,11,'pdf','chengmi.deng',1,'2015-12-15 09:15:12','2015-12-15 09:15:12','public/uploads/pdf/7b22068e593ed9bb1a5b4aacd7c7e538',NULL,NULL,NULL,199467),(114,'loading效果',1,7,'code','jasonroger',1,'0000-00-00 00:00:00','2015-12-16 08:49:42','','<!DOCTYPE html>\n<html>\n<head>\n  <meta charset=\"utf-8\">\n  <title>足迹屋</title>\n</head>\n<body>\n	<div class=\"main\">\n		<div class=\"square-spin\">\n      <div></div>\n    </div>\n	</div>\n</body>\n</html>','html, body {\n	padding: 0;\n	margin: 0;\n	background: #ed5565;\n	color: #fff;\n}\n.main {\n	padding: 30px 40px;\n}\n@keyframes square-spin {\n  25% {\n		background: blue;\n    transform: perspective(100px) rotateX(180deg) rotateY(0);\n	}\n  50% {\n		background: orange;\n    transform: perspective(100px) rotateX(180deg) rotateY(180deg);\n	}\n  75% {\n		background: silver;\n    transform: perspective(100px) rotateX(0) rotateY(180deg);\n	}\n  100% {\n		background: green;\n    transform: perspective(100px) rotateX(0) rotateY(0);\n	}\n}\n.square-spin > div {\n  animation-fill-mode: both;\n  width: 70px;\n  height: 70px;\n  background: #fff;\n  animation: square-spin 3s 0s cubic-bezier(.09, .57, .49, .9) infinite;\n}','',0),(116,'系统使用说明',1,13,'markdown','test',1,'2015-12-16 05:59:00','2015-12-16 05:59:00','***\n# 欢迎使用云笔记系统\n\n------\n为了便于大家管理自己的技术资料，项目资料以及生活中的琐事儿，我们为大家开发了一个云笔记系统，通过该系统你可以实现如下管理：\n\n> 私人定制管理目录\n> 创建markdown文档\n> 在线编辑web代码\n> 创建word文档\n> 可以无限的嵌套目录\n\n------\n\n## 系统整体介绍\n\n![](/images/whole.png)\n- 通过点击左上方的**+**号，你可以创建属于自己的管理主题\n- 通过在空白区域单击右键，将会出现右键菜单\n- 通过右上角的人头图标，你可以修改密码或者推出系统\n\n### 1. 新建markdown文档\n![](/images/markdown.png)\n\n如果不熟悉markdown文档的基本语法，建议百度了解一下，为了便于大家使用，我们特意添加了工具栏，通过工具栏，你可以很方便的创建属于自己的markdown文档，另外每次新建时，都会默认给出常用的markdown文档，供大家参考。\n\n### 2. 在线编辑代码（新建代码）\n![](/images/code.png)\n\n在线编辑器分做三个区域，左上方为html代码编辑区，左下方为javascript编辑器，中间部分为css代码编辑区，右方为效果预览区。如果你想预览html和js代码，只需按ctrl + s键便可在右方预览效果，对于css代码，则是实时预览，另外js默认引入jquery，所以你可以放心的使用jquery来进行编码。\n### 3. 新建word文档\n![](/images/word.png)\n\n作者 [@jasonroger]   \n2015 年 11月 06日    \n\n***\n\n\n',NULL,NULL,NULL,0),(117,'正则表达式.pdf',1,14,'pdf','test',1,'2015-12-16 05:59:00','2015-12-16 05:59:00','public/uploads/pdf/7b22068e593ed9bb1a5b4aacd7c7e538',NULL,NULL,NULL,199467),(118,'test',1,12,'code','test',1,'0000-00-00 00:00:00','2015-12-16 06:05:03','','\"<!DOCTYPE html>\\n<html>\\n<head>\\n  <meta charset=\\\"utf-8\\\">\\n  <title>足迹屋</title>\\n</head>\\n<body>\\n\\t<div class=\\\"main\\\">\\n\\t\\t<div class=\\\"square-spin\\\">\\n      <div></div>\\n    </div>\\n\\t</div>\\n</body>\\n</html>\"','\"html, body {\\n\\tpadding: 0;\\n\\tmargin: 0;\\n\\tbackground: #ed5565;\\n\\tcolor: #fff;\\n}\\n.main {\\n\\tpadding: 30px 40px;\\n}\\n@keyframes square-spin {\\n  25% {\\n\\t\\tbackground: blue;\\n    transform: perspective(100px) rotateX(180deg) rotateY(0);\\n\\t}\\n  50% {\\n\\t\\tbackground: orange;\\n    transform: perspective(100px) rotateX(180deg) rotateY(180deg);\\n\\t}\\n  75% {\\n\\t\\tbackgrou